import React from 'react';
import './LectureClass.css';

function LectureClass() {
    return (
        <div className='expenses-item'>
            <div className='expense-item h2'>Year 2023</div>
            <div className='expense-item__description'>Total Student: <span>345</span></div>
        </div>
    )
}

export default LectureClass;
